import React from 'react';


function Challange(){
    <>
<ol>
    <li>Sum of the two num is: {add(34, 7)} </li>;
    <li>Subtraction of the two num is: {sub(34, 7)} </li>;
    <li>Multiplication of the two num is: {mul(34, 7)} </li>;
    <li>Devision of the two num is: {div(34, 7)} </li>;
</ol>

    </>
    return Challange;
}

export default Challange;
